import React from "react";

function NavTop() {
  return (
   <header>
      <div className="top-nav">
      {/* <img className = "top-image" src=""></img> */}
        <div className="top-item">
        <i class="fas fa-hammer"></i>
          <p>One</p>
        </div>
        <div className="top-item">
          <p>Two</p>
        </div>
        <div className="top-item">
          <p>Three</p>
        </div>
      </div>
      </header>
  );
}

export default NavTop;
